"""
Installs the RsInstrument 1.53.0 and its dependencies to the executing python environment.
Also works for virtual environments.
Usage: Just execute it in your offline PC in Python 3.6+
"""

import base64
import sys
import subprocess
import shutil
import os


def int_encoded_version_to_version_str(encoded_ver: int) -> str:
    """Converts integer e.g.: 3006000 to '3.6.0'"""
    major = encoded_ver // 1000000
    minor = (encoded_ver - major * 1000000) // 1000
    version_str = f'{major}.{minor}.0'
    return version_str


def main():
    zip_content = b''

    package_zip_temp_file = 'temp.zip'
    packages_sub_folder = 'wheelhouse'

    try:
        if len(zip_content) == 0:
            # For template debugging purposes
            with open('example_wheelhouse.zip', 'rb') as file:
                data = file.read()
                zip_content = base64.b64encode(data)

        # Delete the wheelhouse folder
        if os.path.exists(packages_sub_folder):
            shutil.rmtree(packages_sub_folder)

        # Take the bin data and save it as a temporary zip file
        with open(package_zip_temp_file, 'wb') as file:
            data = base64.b64decode(zip_content)
            file.write(data)

        # Unzip the zip file
        shutil.unpack_archive(package_zip_temp_file, packages_sub_folder, 'zip')

        version = sys.version.split(' ')[0]
        # For testing purposes
        # version = '3.9.1'
        print(f'Your python version: {version}')

        # Selecting the most actual requirements file based on the current python version
        version_lst = version.split('.')
        version_int = int(version_lst[0]) * 1000000 + int(version_lst[1]) * 1000
        req_list = os.listdir(packages_sub_folder)
        req_list = list(filter(lambda x: 'requirements_' in x, req_list))

        sel_req_file = None
        sel_req_version = 0
        min_req = None
        for req_file in req_list:
            req_version_int = int(req_file.replace('requirements_', '').replace('.txt', ''))
            if req_version_int is None or req_version_int <= version_int:
                sel_req_file = req_file
                sel_req_version = req_version_int

            if min_req is None or min_req > req_version_int:
                min_req = req_version_int

        min_version = int_encoded_version_to_version_str(min_req)
        print(f'Minimum supported version: {min_version}')

        if sel_req_file is None:
            raise Exception(f'Your current python version {version} is older than the minimum supported version of this installer {min_version}. Please upgrade your python')

        sel_version = int_encoded_version_to_version_str(sel_req_version)
        print(f'Selected package version: {sel_version}')
        subprocess.check_call([sys.executable, '-m', 'pip',
                               'install',
                               '-r',
                               f'./{packages_sub_folder}/{sel_req_file}',
                               '--no-index',
                               '--find-links', f'./{packages_sub_folder}'])
    except subprocess.CalledProcessError as e:
        print(e.output)

    finally:
        if os.path.exists(package_zip_temp_file):
            os.remove(package_zip_temp_file)

        if os.path.exists(packages_sub_folder):
            shutil.rmtree(packages_sub_folder)


if __name__ == '__main__':
    main()
